export const handleMinScore = (score) => {
    return {
        type: 'handleMinScore',
        payload: score
    }
}
export const handleLevel = (level) => {
    return {
        type: 'handleLevel',
        payload: level
    }
}
export const handleArrange = (arrange) => {
    return {
        type: 'handleArrange',
        payload: arrange
    }
}
